import React, {useState, useEffect} from "react";
import Base from "../core/Base";
import SearchBox from "./Searcbox";
import {fetchFavs} from "../home/searchHelper/FetchInfoHelper";

const Test = () => {

  const [favs, setFavs] = useState("");

  useEffect(() => {
    fetchFavs()
    .then((data) => {
      if(data.error){
        setFavs("");
      }
      else{
        setFavs({data})
      }
    })
    .catch((err) => {
      console.log(err)
    })
  },[])


  return(
    <Base>
    <div className="row">
      <div className="container">
        <div className="col-md-12">
          <div className="text-center sitename">
            <h1>Riafy Stockz</h1>
            <p className="">
              "Stock analysis and screening tool for investors in India."
            </p>
            <SearchBox />
            <div className="favlist mt-4">
                {
                  favs.map((value, idx) => (
                    <div key="idx"> dddd</div>
                  ))
                }
            </div>
          </div>
        </div>
      </div>
    </div>
  </Base>
  )

};

export default Test;
